import React from "react";
import Button from "@material-ui/core/Button";
import ButtonGroup from "@material-ui/core/ButtonGroup";
import { makeStyles } from "@material-ui/core/styles";

const useStyles = makeStyles((theme) => ({
  root: {
    display: "flex",
    "& > *": {
      margin: theme.spacing(1),
    },
  },
}));

function MenuOps() {
  const classes = useStyles();
  return (
    <div className={classes.root}>
      <ButtonGroup
        orientation="vertical"
        color="primary"
        aria-label="vertical contained primary button group"
        variant="text"
        size ="large"
      >
        <Button><a style={href} href="/pos">POS</a></Button>
        <Button><a style={href} href="/sells">SELLS</a></Button>
        <Button><a style={href} href="/transHistory">TRANSCTION HISTORY</a></Button>
        <Button><a href="/customerInfo">CUSTOMER INFO</a></Button>
        <Button><a href="/employee">EMPLOYEE INFO</a></Button>
      </ButtonGroup>
    </div>
  );
}

export default MenuOps;
